d3.selectAll('.axis--x .tick text').text(function(d){return moment(d,i ).format('YYYY')});
d3.selectAll('path.line').style('stroke', '#aaa').style('stroke-width', 2);

d3.selectAll('svg text.label').filter(function(e){return e.name_site == 'RichardLenoir'}).text('Richard Lenoir')

d3.selectAll('circle.dotPoint').on('mouseover', function(d){
show_tooltip(d);
d3.selectAll('path.line').filter(function(e){return e[0].name_site != d.name_site}).style('opacity', .5).style('stroke-width', 2).style('stroke', '#bbb');
d3.selectAll('path.line').filter(function(e){return e[0].name_site == d.name_site}).style('stroke-width', 3).style('opacity', 1).style('stroke', 'red');
d3.selectAll('svg text.label').style('opacity', 0.5).style('fill', '#aaa');
d3.selectAll('svg text.label').filter(function(e){return e.name_site == d.name_site}).style('fill', 'red').style('opacity', 1);
;});
d3.selectAll('circle.dotPoint').on('mouseout', function(d){
hide_tooltip(d);
d3.selectAll('path.line').style('stroke-width', 2).style('stroke', '#aaa').style('opacity', 1);
d3.selectAll('svg text.label').style('opacity', 0.9).style('fill', '#aaa');
});
